// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;
// pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/proxy/Initializable.sol";
import '@openzeppelin/contracts/utils/ReentrancyGuard.sol';

import "./FwarMiningStorage.sol";

interface ISeed {
    function getSeed() external returns(uint256);
}

interface IFwarBlackList {
    function isBlackList(address _address) external view returns (bool);
}

interface IFwarChar {
    function getHash(uint32 _id) external view returns (uint32 hash);
}

interface IFwarMarket {
    function getSellingNFT(uint _nftId, address _nftContract) external view returns (uint);
}

contract FwarMining is Initializable, AccessControl, Ownable, ReentrancyGuard, FwarMiningStorage {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    event Stake(address indexed _owner, uint32[] _nftIds, uint _amount);
    event Unstake(address indexed _owner, uint32[] _nftIds, uint _amount);
    event Claim(address indexed _owner, uint _amount);

    function initialize(
        address admin,
        uint256 _startBlock,
        uint256 _fwtPerBlock,
        address _fwtAddress,
        address _seedAddress,
        address _blackListAddress,
        address _fwarMarketAddress,
        address _nftContract
    ) public payable initializer {

        _setupRole(DEFAULT_ADMIN_ROLE, admin);

        startBlock = _startBlock;
        fwtPerBlock = _fwtPerBlock;
        fwtAddress = _fwtAddress;
        seedAddress = _seedAddress;
        blackListAddress = _blackListAddress;
        fwarMarketAddress = _fwarMarketAddress;
        nftContract = _nftContract;
    }

    // only called by owner once a day
    function setFWTPerBlock(uint256 _fwtPerBlock) external {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        fwtPerBlock = _fwtPerBlock;
    }

    function setBlackListAddress(address _blackListAddress) external{
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        blackListAddress = _blackListAddress;
    }

    function setNFTAddress(address _nftContract) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        nftContract = _nftContract;
    }

    function setSeedAddress(address _seedAddress) external {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        seedAddress = _seedAddress;
    }

    function setFwarMarketAddress(address _fwarMarketAddress) external {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        fwarMarketAddress = _fwarMarketAddress;
    }

    function setStakingNFT(uint[] calldata _nftIds, uint[] calldata _values) external {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        for (uint i = 0; i < _nftIds.length; i++) {
            require(_nftIds[i] != 0, "_nftIds error");
            stakingNFT[_nftIds[i]] = _values[i];
        }
    }

    function setHash(address _user, uint _hash) external {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        if(totalHash >= _hash) {
          totalHash = totalHash.sub(userInfo[_user].hash).add(_hash);
          userInfo[_user].hash = _hash;
        }
    }

    function getStakingNFT(uint _nftId) external view returns (uint) {
        return stakingNFT[_nftId];
    }

    function getTotalHash() external view returns (uint) {
        return totalHash;
    }

    function getUserInfo(address _user) external view returns (uint hash, uint rewardDebt, uint lastStakeTime) {
      UserInfo storage user = userInfo[_user];
      return(user.hash, user.rewardDebt, user.lastStakeTime);
    }

    function getMultiplier(uint256 _from, uint256 _to) public pure returns (uint256) {
        return _to.sub(_from);
    }

    // View fwt pending by user
    function pendingFWT(address _user) external view returns (uint256) {
        UserInfo storage user = userInfo[_user];
        uint256 accFWTPerShareTemp = accFWTPerShare;
        if (block.number > lastRewardBlock && totalHash != 0) {
            uint256 multiplier = getMultiplier(lastRewardBlock, block.number);
            uint256 fwtReward = multiplier.mul(fwtPerBlock);
            accFWTPerShareTemp = accFWTPerShareTemp.add(fwtReward.mul(1e12).div(totalHash));
        }
        return user.hash.mul(accFWTPerShareTemp).div(1e12).sub(user.rewardDebt);
    }

    //Update mining infomation
    function updateMining() public {
        if (block.number <= lastRewardBlock) {
            return;
        }
        if (totalHash == 0) {
            lastRewardBlock = block.number;
            return;
        }
        uint256 multiplier = getMultiplier(lastRewardBlock, block.number);
        uint256 fwtReward = multiplier.mul(fwtPerBlock);
        accFWTPerShare = accFWTPerShare.add(fwtReward.mul(1e12).div(totalHash));
        lastRewardBlock = block.number;
        //Call for generate new seed for random
        ISeed(seedAddress).getSeed();
    }

    /// @dev stake is called by a user
    /// @param _nftIds is the array of nftId to stake
    function stake(uint32[] calldata _nftIds) external nonReentrant{
        require(_msgSender() == tx.origin, "FWarMining: Can not call from contract");
        require(!IFwarBlackList(blackListAddress).isBlackList(_msgSender()), "You are in black list");
        require(_nftIds.length <= 20, "amount stake nft exceed ");

        uint amount = 0;

        for (uint i = 0; i < _nftIds.length; i++) {
            require(_nftIds[i] != 0, "_nftIds error");
            require(IERC721(nftContract).ownerOf(_nftIds[i]) == _msgSender(), "NFT not yours");
            require(stakingNFT[_nftIds[i]] == 0, "NFT is staking");
            require(IFwarMarket(fwarMarketAddress).getSellingNFT(_nftIds[i], nftContract) == 0, "NFT is selling");
            stakingNFT[_nftIds[i]] = _nftIds[i];
            amount = amount.add(IFwarChar(nftContract).getHash(_nftIds[i]));
        }

        UserInfo storage user = userInfo[_msgSender()];

        updateMining();

        if (user.hash > 0) {
            uint256 pending = user.hash.mul(accFWTPerShare).div(1e12).sub(user.rewardDebt);
            if (pending > 0) {
              IERC20(fwtAddress).transfer(_msgSender(), pending);
            }
        }

        if (amount > 0) {
            user.hash = user.hash.add(amount);
            totalHash = totalHash.add(amount);
        }

        user.rewardDebt = user.hash.mul(accFWTPerShare).div(1e12);
        user.lastStakeTime = block.timestamp;

        emit Stake(_msgSender(), _nftIds, amount);
    }

    /// @dev unStake is called by a user
    /// @param _nftIds is the array of nftId to unStake
    function unStake(uint32[] calldata _nftIds) external nonReentrant{
        require(_msgSender() == tx.origin, "FWarMining: Can not call from contract");
        require(!IFwarBlackList(blackListAddress).isBlackList(_msgSender()), "You are in black list");
        require(_nftIds.length <= 20, "amount stake nft exceed ");

        uint amount = 0;

        for (uint i = 0; i < _nftIds.length; i++) {
            require(_nftIds[i] != 0, "_nftIds error");
            require(IERC721(nftContract).ownerOf(_nftIds[i]) == _msgSender(), "NFT not yours");
            require(stakingNFT[_nftIds[i]] != 0, "NFT should be staking");
            delete stakingNFT[_nftIds[i]];

            amount = amount.add(IFwarChar(nftContract).getHash(_nftIds[i]));
        }

        UserInfo storage user = userInfo[_msgSender()];
        require(user.hash >= amount, "unStake: hash is exceed to balance");

        updateMining();

        uint256 pending = user.hash.mul(accFWTPerShare).div(1e12).sub(user.rewardDebt);
        if (pending > 0) {
            IERC20(fwtAddress).transfer(_msgSender(), pending);
        }

        if (amount > 0) {
            user.hash = user.hash.sub(amount);
            totalHash = totalHash.sub(amount);
        }
        user.rewardDebt = user.hash.mul(accFWTPerShare).div(1e12);

        emit Unstake(_msgSender(), _nftIds, amount);
    }

    function claim() public nonReentrant{
        UserInfo storage user = userInfo[_msgSender()];
        updateMining();
        uint256 pending = user.hash.mul(accFWTPerShare).div(1e12).sub(user.rewardDebt);
        if (pending > 0) {
            IERC20(fwtAddress).transfer(_msgSender(), pending);
        }
        user.rewardDebt = user.hash.mul(accFWTPerShare).div(1e12);
        emit Claim(_msgSender(), pending);
    }

    receive() external payable {}

    // function to allow admin to claim *other* ERC20 tokens sent to this contract (by mistake)
    function withdrawERC20Tokens(address _tokenAddress, uint _amount) external onlyOwner {
        IERC20(_tokenAddress).transfer(_msgSender(), _amount);
    }
}
